import "./quotetable.css"
import React, { Component } from 'react'

export class QuoteTable extends Component {
    tableData = [
        {
            id: 1,
            name: 'Tim',
            age: 25,
        },
        {
            id: 2,
            name: 'Jane',
            age: 22,
        },
    ]
    render() {
        var heading = ["Quote Data", "Gallons", "Delivery Date", "PPG", "Total"];

        return (
            <div className="table-container">
                <table className="quote-table">
                    <thead>
                        <tr>
                            <td>Quote Date</td>
                            <td>Gallons</td>
                            <td>Delivery Date</td>
                            <td>PPG</td>
                            <td>Total</td>
                        </tr>
                    </thead>
                    <tbody>
                        {this.tableData.map((item, key) => {
                            return (
                                <tr key={key} >
                                    <td><center>{item.id}</center></td>
                                    <td><center>{item.name}</center></td>
                                    <td>{item.Nombres}</td>
                                    <td>{item.Apellidos}</td>
                                    <td>{item.Grado}</td>
                                </tr>
                            )
                        })}
                    </tbody>
                </table>
            </div >
        )
    }
}

export default QuoteTable
